CREATE TABLE dfe_ncm_nbs_ibs_cbs (
    id_ncm_nbs_ibs_cbs INTEGER NOT NULL,
    id_cclass_ibs_cbs INTEGER,
    cst_ibs_cbs VARCHAR(3),
    cclass_trib VARCHAR(6),
    ncm_nbs_ibs_cbs VARCHAR(9),
    nome_ncm_nbs_ibs_cbs VARCHAR(2000),
    tipo_ncm_nbs_ibs_cbs CHAR(3),
    dt_ini_vig DATE,
    dt_fim_vig DATE,
    CONSTRAINT pk_dfe_ncm_nbs_ibs_cbs PRIMARY KEY (id_ncm_nbs_ibs_cbs)
);

-- Gerador para simular AUTO_INCREMENT
CREATE SEQUENCE gen_dfe_ncm_nbs_ibs_cbs;

-- Trigger para auto incremento
SET TERM !! ;
CREATE TRIGGER trg_dfe_ncm_nbs_ibs_cbs_ai FOR dfe_ncm_nbs_ibs_cbs
ACTIVE BEFORE INSERT POSITION 0
AS
BEGIN
  IF (NEW.id_ncm_nbs_ibs_cbs IS NULL) THEN
    NEW.id_ncm_nbs_ibs_cbs = NEXT VALUE FOR gen_dfe_ncm_nbs_ibs_cbs;
END !!
SET TERM ; !!

